import './App.css';
import {Home} from './Components/Home/Home';
import {BrowserRouter as Router, Route, Link} from "react-router-dom";

function App() {
  return (
    <Router>
      <Route>
        <Home/>
      </Route>
      <Route path='/profile'>
        <Profile />
      </Route>
    </Router>
  );
}

export default App;
